import React, { useEffect, useState } from "react";
import axios from "axios";
import AssignmentIndIcon from "@mui/icons-material/AssignmentInd";
import BusinessIcon from "@mui/icons-material/Business";
import PanToolIcon from "@mui/icons-material/PanTool";
import HouseIcon from "@mui/icons-material/House";
import AccessibilityIcon from "@mui/icons-material/Accessibility";
import "../style/Cadastro.css";
import CameraAltIcon from "@mui/icons-material/CameraAlt";

const InputsIconNextPage = () => {
  const [userCuidadorNext, setUserCuidador] = useState({
    cpf: "",
    foto: "",
    biografia: "",
    possuiAnimais: "",
    possuiCriancas: "",
    preferencias: "",
    moradia: "",
    limitacoes: "",
    avaliacao: "",
    idSexoHost: "",
  });
  console.log(userCuidadorNext);
  const handleUserCuidadorNextSubmit = (userCuidador) => {
    axios.defaults.headers.post["Content-Type"] =
      "application/json;charset=utf-8";
    axios.defaults.headers.post["Access-Control-Allow-Origin"] = "*";
    axios
      .post("http://localhost/Cuidador/Cliente/api/cliente", userCuidador)
      .then((res) => console.log(res.data));
  };
  const listElements = () => {
    axios
      .get("http://localhost/Cuidador/Cliente/api/cliente")
      .then((res) => console.log(res.data));
  };
  useEffect(() => {
    listElements();
  }, []);

  function testeClick() {
    console.log("ola");
  }

  return (
    <>
      {" "}
      <form onSubmit={() => handleUserCuidadorNextSubmit(userCuidadorNext)}>
      <div id="containerInput">
          <div id="containerBorderImage">
            <input
              type="file"
              name="inputImage"
              className="inputImage"
              id="foto"
              value={user.foto}
              onChange={(e) => setUser({ ...user, foto: e.target.value })}
            />
            <CameraAltIcon id="iconInputCamera" />
          </div>
        </div>
        <div id="contInputsPet">
          <select value={userCuidadorNext.idSexoHost} id="InputsContainerSelect">
            <option value={userCuidadorNext.idMasculino}>Masculino</option>
            <option value={userCuidador.idFemininio}>Femininio</option>
          </select>
          <AssignmentIndIcon id="iconInputLabel" />
          <input
            label="CPF"
            id="cpf"
            className="containerInputs"
            placeholder="CPF"
          />
        </div>
        <div id="contInputsPetCheckbox">
          <div id="contInputCheckbox">
            <label className="labelInputCheckboxCuidador">
              Possui Animais
              <input type="checkbox" value={userCuidador.possuiAnimais} />
              <span className="checkmarkCuidador"></span>
            </label>
          </div>
          <div id="contInputCheckbox">
            <label className="labelInputCheckboxCuidador">
              Possui Crianças?
              <input type="checkbox" value={userCuidador.possuiCriancas}/>
              <span className="checkmarkCuidador"></span>
            </label>
          </div>
        </div>
        <div id="contInputsPet">
          <PanToolIcon id="iconInputLabel" />
          <input
            label="Preferências"
            id="limitacoes"
            className="containerInputLimitacoes"
            placeholder="Você possui limitações?"
            value={userCuidador.possuiLimitacoes}
          />
        </div>
        <div id="contInputsMoradia">
          <BusinessIcon id="iconInputLabel" />
          <input
            id="cep"
            placeholder="Informe seu cep"
            type="number"
            value={userCuidador.cep}
            required
          />
          <HouseIcon id="iconInputLabel" />
          <input
            label="Moradia"
            id="moradia"
            className="containerInputMoradia"
            placeholder="Aonde você reside?"
            value={userCuidador.moradia}
            required
          />
          <div>
            <AccessibilityIcon id="iconInputLabel" />
            <input
              label="Preferências"
              id="preferencias"
              placeholder="Possui alguma preferência?"
              className="containerInputPreferencias"
              valuyen={userCuidador.preferencias}
            />
          </div>
          <div id="containerButton">
            <input
              value="Cadastrar"
              type="submit"
              name="inputConfirmarSenha"
              id="buttonCadastrar"
              className="button"
            />
          </div>
        </div>
      </form>
    </>
  );
};

export default InputsIconNextPage;
